--FLAGS:
--0=Solid
--1=Buy items
--2=Trapdoor
--3=Sign/Text
--4=Save
--5=TP to Void relm IF Kraa has been foughten once.
--6=Barrel/Give random Item

t=0
x=7*8
y=3*8

function TIC()

	if btnp(0) then y=y-8 end
	if btnp(1) then y=y+8 end
	if btnp(2) then x=x-8 f=1 end
	if btnp(3) then x=x+8 f=0 end

	cls(0)
	map(0,0,31,17,0,0)
	spr(358+t%60//30,x,y,0,1,f)
	t=t+1
end

